-- get next coordinate given the current position and a delta
next :: Double -> Double -> Double -> (Double, Double)
next x0 y0 delta =
  let slopeX = dx x0 y0 in
  let slopeY = dy x0 y0 in
  let dynamic_delta = delta / (sqrt ( slopeX**2 + slopeY**2 )) in
  let deltaX = (slopeX * dynamic_delta) in
  let deltaY = (slopeY * dynamic_delta) in
  let x1 = x0 + deltaX in
  let y1 = y0 + deltaY in
  let x2 = x0 - deltaX in
  let y2 = y0 - deltaY in
  if f x1 y1 < f x2 y2
    then (x1, y1)
    else (x2, y2)

path :: Double -> Double -> Double -> Integer -> [(Double, Double)]
path x0 y0 delta limit =
  path' x0 y0 delta limit [(x0, y0)]

path' :: Double -> Double -> Double -> Integer -> [(Double, Double)] -> [(Double, Double)]
path' x0 y0 delta limit previous =
  if limit <= 0
    then previous
  else
    let coord = next x0 y0 delta in
    if coord == (x0, y0)
      then previous
      else path' (fst coord) (snd coord) delta (limit - 1) (previous ++ [coord])

wolframArray :: [String] -> String
wolframArray array = wolframArray' array ""

wolframArray' :: [String] -> String -> String
wolframArray' array string =
  if length array == 0
    then "{" ++ string ++ "}"
    else
      if length string > 0
        then wolframArray' (drop 1 array) (string ++ "," ++ (array !! 0))
        else wolframArray' (drop 1 array) (array !! 0)

wolframPoint :: (Double, Double) -> String
wolframPoint point = "{" ++ (show $ fst point) ++ "," ++ (show $ snd point) ++ "," ++ (show $ (f (fst point) (snd point))) ++ "}"

wolframString :: [(Double, Double)] -> String
wolframString points = wolframArray $ map wolframPoint points

gnuPlotPoint :: (Double, Double) -> String
gnuPlotPoint point = (show $ fst point) ++ " " ++ (show $ snd point) ++ " " ++ (show $ (f (fst point) (snd point))) ++ "\n"

gnuPlotString :: [(Double, Double)] -> String
gnuPlotString points = intercalate "" (map gnuPlotPoint points)